def plot_steadystate(x, prR200, prR300, prR400, prW200, prW300, prW400, label, GENvalue, path):
    name = label
    if label == "unreliability":
        plt.ylim(0, 0.002)
    if label == "unavailability":
        plt.ylim(0, 0.017)
    

    # Create a scatter plot with custom colors
    plt.plot(x, prR200, marker="d", label=r"mixed rejuvenation - $\gamma(t)=\rho(t)\in [0.8, 0.95]$", color="darkorchid")
    """plt.plot(x, prR300, marker="d", label=r"mixed rejuvenation - $\gamma(t)=\rho(t)\in [0.8, 0.95], t \in [100,300]$", color="green")
    plt.plot(x, prR400, marker="x", label=r"mixed rejuvenation - $\gamma(t)=\rho(t)\in [0.8, 0.95], t \in [100,400]$", color="green")"""
    plt.plot(x, prW200, marker="o", label=r"mixed rejuvenation - $\gamma(t)=\rho(t)\in [0.5, 0.95]$", color="gold")
    """plt.plot(x, prW300, marker="d", label=r"mixed rejuvenation - $\gamma(t)=\rho(t)\in [0.5, 0.95], t \in [100,300]$", color="orange")
    plt.plot(x, prW400, marker="x", label=r"mixed rejuvenation - $\gamma(t)=\rho(t)\in [0.5, 0.95] , t \in [100,400]$", color="orange")"""

    # Customize labels and title
    plt.xlabel("number of inspections", fontsize=12.5)
    plt.ylabel(label, fontsize=12.5)
    plt.xticks(fontsize=12.5)
    plt.yticks(fontsize=12.5)
    plt.grid(True)
    plt.axhline(GENvalue, color='red', linewidth=1.5, zorder=1, label="time-based - bounded regeneration restriction")
    # Add a legend
    plt.legend(fontsize=12.5)
    # Show the plot
    plt.savefig(path + "figures/conditionbased/" + name + "_var.pdf")
    plt.close()

def plot_fixed_steadystate(x, pr90, pr95, pr99, pr9099, pr9990, label, GENvalue, path):
    name = label
    if label == "unreliability":
        plt.ylim(0, 0.002)  
    if label == "unavailability":
        plt.ylim(0, 0.017)  

    # Create a scatter plot with custom colors
    plt.plot(x, pr90, marker="s", label=r"mixed rejuvenation - $\gamma=0.90, \rho=0.90$", color="blue")
