    plt.plot(x, pr9099, marker="x", label=r"mixed rejuvenation - $\gamma=0.90, \rho = 0.99$", color="grey")
    plt.plot(x, pr9990, marker="v", label=r"mixed rejuvenation - $\gamma=0.99, \rho = 0.90$", color="violet")

    # Customize labels and title
